'use strict';
class DXFeedHeartbeatMessage {
    static create(clientId, requestNumberGenerator) {
        return "[{" + "\"id\":\"" + (requestNumberGenerator.getNextRequestNumber()).toString() + "\"," + "\"channel\":\"/meta/connect\"," + "\"clientId\":\"" + clientId + "\"" + "}]";
    }
}
module.exports = DXFeedHeartbeatMessage
